> Sports Blue Jays clinch AL East with 15-2 win over Orioles Toronto Blue Jays relief pitcher LaTroy Hawkins, right, celebrates with catcher Russell Martin, second from left, and teammate Chris Colabello after closing out the first baseball game of a doubleheader against the Baltimore Orioles, Wednesday, Sept. 30, 2015, in Baltimore. Toronto won 15-2 to clinch the American League East. (AP Photo/Patrick Semansky) 
